import React, { useEffect, useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import AboutPage from './AboutPage';
import ServiceCategories from './ServiceSection';

const JRAutoDetailing = () => {
  const [step, setStep] = useState(0);
  const [currentPage, setCurrentPage] = useState('home');

  useEffect(() => {
    const timer = setTimeout(() => {
      setStep(1);
    }, 1500);
    return () => clearTimeout(timer);
  }, []);

  const handleAnimationComplete = () => {
    setTimeout(() => {
      setStep(2);
    }, 4000);
  };

  const variants = {
    hidden: { opacity: 0, y: 50 },
    visible: { 
      opacity: 1, 
      y: 0, 
      transition: { duration: 1, ease: "easeOut" }
    },
    exit: { 
      opacity: 0, 
      y: -50, 
      transition: { duration: 1, ease: "easeIn" }
    },
  };

  const pageVariants = {
    initial: { opacity: 0, x: '-100%' },
    in: { opacity: 1, x: 0 },
    out: { opacity: 0, x: '100%' },
  };

  const pageTransition = {
    type: 'tween',
    ease: 'anticipate',
    duration: 0.5
  };

  const textVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { 
      opacity: 1, 
      y: 0, 
      transition: { duration: 0.8, ease: "easeOut" }
    },
  };

  const renderPage = () => {
    switch (currentPage) {
      case 'about':
        return <AboutPage />;
      case 'services':
        return <ServiceCategories />;
      case 'contact':
        return <div className="text-stone-100 text-2xl">Contact Page (To be implemented)</div>;
      default:
        return null;
    }
  };

  return (
    <div className="relative w-full h-screen bg-stone-900 overflow-hidden font-sans">
      <AnimatePresence mode="wait">
        {step === 0 && (
          <motion.div
            key="background"
            initial="hidden"
            animate="visible"
            exit="exit"
            variants={variants}
            className="absolute inset-0 bg-stone-900"
          />
        )}
        {step === 1 && (
          <motion.div
            key="image"
            initial="hidden"
            animate="visible"
            exit="exit"
            variants={variants}
            className="absolute inset-0 flex flex-col items-center justify-center text-stone-100"
            onAnimationComplete={handleAnimationComplete}
          >
            <motion.div 
              variants={textVariants}
              className="text-sm mb-4 tracking-widest"
            >
              LOCATED IN SURREY, B.C.
            </motion.div>
            <motion.div 
              variants={textVariants}
              className="text-7xl font-bold mb-6 tracking-tight"
              style={{ fontFamily: "'Helvetica Neue', Arial, sans-serif" }}
            >
              JR AUTO DETAILING
            </motion.div>
            <motion.div 
              variants={textVariants}
              className="text-xl mb-4 tracking-wide"
            >
              PREMIUM CAR CARE EXPERIENCE
            </motion.div>
            <motion.div 
              variants={textVariants}
              className="text-sm tracking-widest"
            >
              SERVING THE LOWER MAINLAND
            </motion.div>
          </motion.div>
        )}
        {step === 2 && (
          <>
            <motion.div
              key="content"
              initial="initial"
              animate="in"
              exit="out"
              variants={pageVariants}
              transition={pageTransition}
              className="absolute inset-0 overflow-auto bg-stone-800"
            >
              {renderPage()}
            </motion.div>
            <motion.div
              initial={{ opacity: 0, y: -20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, ease: "easeOut" }}
              className="absolute top-0 left-0 right-0 z-10 p-6"
            >
              <nav className="flex justify-between items-center">
                <motion.div 
                  className="text-xl font-bold text-stone-100 cursor-pointer"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                  onClick={() => setStep(1)}
                >
                  JR AUTO
                </motion.div>
                <div className="space-x-6">
                  {['About', 'Services', 'Contact'].map((item, index) => (
                    <motion.button
                      key={item}
                      className="text-stone-300 hover:text-stone-100 transition-colors duration-300"
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.95 }}
                      initial={{ opacity: 0, y: -20 }}
                      animate={{ opacity: 1, y: 0 }}
                      transition={{ duration: 0.5, delay: index * 0.1 }}
                      onClick={() => setCurrentPage(item.toLowerCase())}
                    >
                      {item}
                    </motion.button>
                  ))}
                </div>
              </nav>
            </motion.div>
          </>
        )}
      </AnimatePresence>
    </div>
  );
};

export default JRAutoDetailing;
